// Grab the raw string from the previous node
const raw = $json.output;

// Parse it into an object
let parsed;
try {
  parsed = JSON.parse(raw);
} catch (e) {
  throw new Error(`Could not parse JSON from output: ${e.message}`);
}

// Return the parsed JSON as your new item
return [
  {
    json: parsed
  }
];
